export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},"5OYu9E7bgn":{data:{id:1028,attributes:{imdbId:"tt0034711",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTBjZDY5YjctNzY3MS00Yjg0LWJiZjQtOGVhNGViZjJiZWZhXkEyXkFqcGdeQXVyNjA2ODA0Nzc@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"}],item_lang:{data:{id:1691,attributes:{title:e,plot:"Blind detective Duncan Maclain is visited by old friend Norma Lawry, looking for help in getting rid of one of her old beaus, who is courting Norma's 17-year old step-daughter. When the old beau is found murdered, Norma is the chief suspect until Duncan (aided by his guide-dog Friday) pays a visit to her home and uncovers a plot to steal her husband's military secrets for the enemy.",slug:"eyes-in-the-night"}}},books:{data:[{id:5962,attributes:{title:e,description:a,thumbnail:i,authors:[b],firstBook:true,published:j,publisher:a,subtitle:k}},{id:5963,attributes:{title:e,description:a,thumbnail:i,authors:[b],firstBook:d,published:j,publisher:a,subtitle:k}},{id:5964,attributes:{title:"You Die Today!",description:"A shooting outside a Manhattan bar leads a blind detective to a health spa with a dark secret in this mystery by the author of Make Mine Maclain. Late one summer night, Tubby Severn is enjoying a drink at the bar of the Broadway Palace Hotel when a bullet sails past his head—only six inches away. Lots of people might want Tubby dead, but he’s not sure why the cops have arrested his best friend, Ted Yates, a blind army veteran. It seems the gun involved in the shooting was Ted’s service pistol, which was also used in a murder two years ago—and then vanished. Now, with Ted sporting a straitjacket in Bellevue, Tubby turns to Duncan Maclain for help. Maclain agrees to take the case but soon discovers he’s dealing with more than one suspicious death and a peculiar place called Hardesty’s Health Farm, where they help clients shed pounds. As Maclain begins making connections in this twisted puzzle, he and his partner, Spud Savage, must quickly nab the killer before someone else is dropped like dead weight . . . “Suspense! . . . Corking climax!” —Omaha World-Herald “Novel murder device, unique fabric of alibis, deeply knotted puzzle, and engaging detection technique.” —Chicago Tribune Baynard Kendrick was the first American to enlist in the Canadian Army during World War I. While in London, he met a blind English soldier whose observational skills inspired the character of Capt. Duncan Maclain. Kendrick was also a founding member of the Mystery Writers of America and winner of the organization’s Grand Master Award.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rOgREAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:l,publisher:f,subtitle:a}},{id:5965,attributes:{title:"Make Mine Maclain",description:"Three mystery novelettes featuring a blind detective and his two trusty German Shepherds by the author of Out of Control. Following the loss of his sight in World War I, ex–intelligence officer Capt. Duncan Maclain honed his other senses and became one of the most successful and well-known private investigators in New York City. These are some of his adventures . . . In “The Silent Whistle,” the captain heads west to California with his seeing eye dog Schnucke to advise on a television series about a blind man, but things go south when he discovers the studio head’s secretary with a knife in his back . . . In “Melody in Death,” the captain is visiting a friend at the Knickerbocker Opera Company with Schnucke when he finds the body of a wealthy benefactor backstage . . . In “The Murderer Who Wanted More,” a young artist is on edge after she’s attacked in her Manhattan apartment building and almost shot near her aunt’s Staten Island mansion. Fortunately, she has one friend whose unique powers of detection come in handy in times like these: Captain Maclain! Baynard Kendrick was the first American to enlist in the Canadian Army during World War I. While in London, he met a blind English soldier whose observational skills inspired the character of Capt. Duncan Maclain. Kendrick was also a founding member of the Mystery Writers of America and winner of the organization’s Grand Master Award.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hgoPEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2021-02-23",publisher:f,subtitle:a}},{id:5966,attributes:{title:"Out of Control",description:"Murder disrupts a blind PI’s honeymoon in this mix of detective novel and psychological thriller from the author of Death Knell. The wife of a wealthy Tennessee mining tycoon, Marcia Fillmore has worked hard to get to where she is in life. She’s also a woman with a dark past, one she’s put behind her . . . until a man walks into the Black Pigeon in Gatlinburg and takes a seat beside her at the bar. Marcia doesn’t take kindly to him threatening her with blackmail, following her home—or seeing her kiss a man who isn’t her husband. Everything could fall apart. No, something must be done . . . A former intelligence officer in the army, Capt. Duncan Maclain lost his sight in World War I. Since then, he’s honed his other senses and become a successful private detective whose unique skills are sought after frequently. So it’s no surprise when he arrives in the Smoky Mountains with his new bride and the sheriff asks him for help investigating a suspicious car wreck. With evidence that points to foul play, the sheriff and Maclain know they’ve got a killer to catch—but she’s not going to go down without a fight . . . “Ingenious.” —Kirkus Reviews “The most completely evil and yet interesting woman you’ve read about in a long time . . . Superlative!” —Chicago Daily News Baynard Kendrick was the first American to enlist in the Canadian Army during World War I. While in London, he met a blind English soldier whose observational skills inspired the character of Capt. Duncan Maclain. Kendrick was also a founding member of the Mystery Writers of America and winner of the organization’s Grand Master Award.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tugREAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:l,publisher:f,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568464042}}("","Baynard Kendrick","movie",null,"Eyes in the Night","Open Road Media","series",1,"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=j-JLAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","1941-01-01","Photoplay Title of The Odor of Violets","2021-03-09"))